import React from "react";

import logo from "./images/logo.png";
import banner from "./images/banner.png";
import buttonAndroid from "./images/button-android.png";
import buttonApple from "./images/button-apple.png";

import "./styles.css";

const landingPage = () => {
  return (
    <div>
      <div className="row-landing">
        <div>
          <img src={logo} alt="" className="logo" />
          <div>
            <h1 className="title-header"> ios & android </h1>
            <div>
              <p>
                Download Diary muslim app for your <br /> mobile device for the
                easier access <br /> to best offers.
              </p>
              <div>
                <img src={buttonApple} alt="" className="logo" />
                <img src={buttonAndroid} alt="" className="logo" />
              </div>
            </div>
          </div>
        </div>
        <img src={banner} alt="" className="banner" />
      </div>
    </div>
  );
};

export default landingPage;
